sourcesContent:
const data = [
  {
    title: 'Report Publicly',
    description:
      "If you come across a lost pet and want to help someone find their lost pet, just take a photo and share it to your community!",
    imageUrl: process.env.PUBLIC_URL + 'assets/images/backgroundImage.jpg',
    time: 1500,
  },
  {
    title: 'Put up a Flyer',
    description:
      'Looking for your lost pet? A Flyer in the front of the page will surely let your community know and help you.',
    imageUrl: process.env.PUBLIC_URL + 'assets/images/signBackground.jpg',
    time: 1500,
  },
];

export default data;
